        placeholder=" Enter Expense Amount"
        required="true"
      />
      <br />
      <button type="submit">Submit</button>
      <br />
      <h2>Expense Transactions</h2>
      {exp.map((ex) => (
        <div className="inc-list">
          <div> {ex.name}</div>
